                    <h5 class="card-title">Doctor name: {a.name}</h5>
                    <p class="card-text">
                     Number:  {a.contact}
                    </p>
                    <p class="card-text">
                     Email:  {a.email}
                    </p>
                    <button onClick={()=>{apprfn()}} class="btn btn-primary">
                      Approve
                    </button>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default ApproveDoc;
